import React from "react";
import AuthService from "../services/auth.service";
import { useParams } from "react-router-dom";
import image from "../Images/home.jpeg"
import "../components/Member/Member.css"
const Profile = () => {
  const currentManager = AuthService.getCurrentManager();
  console.log(currentManager);
  // console.log(useParams);

  return (
    <div>
      <img src={image} id="imgt2" />
      <div className="card profile">
        <h3 class="prof">Branch Name: <strong>{currentManager.branch.Branch_Name}</strong></h3>
        <h3 class="prof">Branch Location: <strong>{currentManager.branch.Branch_Location}</strong></h3>
        <h3 class="prof">Branch Email: <strong>{currentManager.branch.Branch_Email}</strong></h3>
        <h3 class="prof">Phone Number: <strong>{currentManager.branch.Branch_Phone_Number}</strong></h3>
        <h3 class="prof">Manager ID: <strong>{currentManager.branch.Manager_ID}</strong></h3>
        <h3 class="prof">Manager Name: <strong>{currentManager.branch.Manager_Name}</strong></h3>
        <h3 class="prof">Manager Email: <strong>{currentManager.branch.Manager_Email}</strong></h3>
      </div>
    </div>
  );
};

export default Profile;
